[{"location":"datasets/npd.html#NASA-Precipitation-Datasets","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"","category":"section"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"The precipitation datasets that NASAPrecipitation.jl v0.1 currently supports are retrieved from NASA's EOSDIS OPeNDAP servers.  They are considered to be a NASAPrecipitationDataset type.","category":"page"},{"location":"datasets/npd.html#NASAPrecipitationDataset","page":"NASA Precipitation Datasets","title":"NASAPrecipitationDataset","text":"","category":"section"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"The NASAPrecipitationDataset AbstractType is meant as an overarching type container for information that identifies various NASA Precipitation Datasets.","category":"page"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"NASAPrecipitation.NASAPrecipitationDataset","category":"page"},{"location":"datasets/npd.html#NASAPrecipitation.NASAPrecipitationDataset","page":"NASA Precipitation Datasets","title":"NASAPrecipitation.NASAPrecipitationDataset","text":"NASAPrecipitationDataset{ST<:AbstractString, DT<:TimeType}\n    npdID :: ST\n    lname :: ST\n    doi   :: ST\n    dtbeg :: DT\n    dtend :: DT\n    sroot :: ST\n    hroot :: ST\n    fpref :: ST\n    fsuff :: ST\nend\n\nAbstract supertype for NASA Precipitation datasets on NASA OPeNDAP Servers.\n\nFields:\n\nnpdID : ID for the NASAPrecipitationDataset, used in determining containing folders and filenames of the NetCDF\nlname : The name describing the NASAPrecipitationDataset, used mostly in Logging\ndoi   : The DOI identifier, to be saved into the NetCDF\ndtbeg : The start date (Y,M,D) of our download / analysis\ndtend : The end date (Y,M,D) of our download / analysis\nsroot : The directory in which to save our downloads and analysis files to\nhroot : The URL of the NASA's EOSDIS OPeNDAP server for which this dataset is stored\nfpref : The prefix component of the NetCDF files to be downloaded\nfsuff : The suffix component of the NetCDF files to be downloaded\n\nOf these fields, only dtbeg, dtend and sroot are user-defined.  All other fields are predetermined depending on the type of NASA Precipitation Dataset called.\n\n\n\n\n\n","category":"type"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"All subTypes of the NASAPrecipitationDataset have the same basic fields and structure.","category":"page"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"using NASAPrecipitation\nnpd = IMERGFinalHH(dtbeg=Date(2017,2,1),dtend=Date(2017,2,1),sroot=pwd())\nnpd.dtbeg\nnpd.sroot\nnpd.fpref\ntypeof(npd)\ntypeof(npd) <: NASAPrecipitation.NASAPrecipitationDataset","category":"page"},{"location":"datasets/npd.html#Supported-NASA-Datasets","page":"NASA Precipitation Datasets","title":"Supported NASA Datasets","text":"","category":"section"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"The following datasets are supported in v0.1:","category":"page"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"GPM IMERGv6, 0.1º resolution, 60ºS to 60ºN, represented by the IMERGDataset Type\nFinal runs for Half-Hourly, Daily and Monthly Data\nEarly and Late runs of Half-Hourly and Daily Data\nTRMM TMPAv7, 0.25º resolution, 50ºS to 50ºN, represented by the TRMMataset Type\nFinal runs for 3-Hourly, Daily and Monthly Data\nNear Real-Time runs of 3-Hourly and Daily Data","category":"page"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"NASAPrecipitation.IMERGDataset\nNASAPrecipitation.TRMMDataset","category":"page"},{"location":"datasets/npd.html#NASAPrecipitation.IMERGDataset","page":"NASA Precipitation Datasets","title":"NASAPrecipitation.IMERGDataset","text":"IMERGDataset <: NASAPrecipitationDataset\n\nAbstract supertype for GPM IMERG datasets on NASA OPeNDAP Servers, a subType of NASAPrecipitationDataset.\n\n\n\n\n\n","category":"type"},{"location":"datasets/npd.html#NASAPrecipitation.TRMMDataset","page":"NASA Precipitation Datasets","title":"NASAPrecipitation.TRMMDataset","text":"TRMMDataset <: NASAPrecipitationDataset\n\nAbstract supertype for TRMM TMPA datasets on NASA OPeNDAP Servers, a subType of NASAPrecipitationDataset.\n\n\n\n\n\n","category":"type"},{"location":"datasets/npd.html","page":"NASA Precipitation Datasets","title":"NASA Precipitation Datasets","text":"Each of these Abstract superTypes has its own set of Types.  See the respective pages for GPM IMERG and TRMM TMPA for more information.","category":"page"},{"location":"datasets/trmm.html#TRMM-TMPA-Datasets","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"","category":"section"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"TRMM TMPA Datasets are represented by the TRMMDataset AbstractType, which in itself is broken into the TRMM3Hourly, TRMMDaily and TRMMMonthly Types.  For 3-hourly and daily datsets, NASA provides not just the output from the final processing run, but also near real-time runs.","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"The Types that each dataset calls are listed below, along with their function calls.","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":" Type Near Real-Time Final\n3 Hour TRMM3Hourly TRMM3HourlyNRT() TRMM3Hourly()\nDaily TRMMDaily TRMMDailyNRT() TRMMDaily()\nMonthly TRMMMonthly  TRMMMonthly()","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"So, for example, if we wanted to get the the Near Real-Time TRMM 3-Hourly dataset, we would call the function TRMMMonthly(), which would return a TRMMMonthly data structure (see example at the end of the page).","category":"page"},{"location":"datasets/trmm.html#TRMMDataset-Types-/-Objects","page":"TRMM TMPA Datasets","title":"TRMMDataset Types / Objects","text":"","category":"section"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"There are three different Types of TRMMDataset:","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"TRMM3Hourly, which is used to contain information on half-hourly TRMM TMPA datasets\nTRMMDaily, which is used to contain information on daily TRMM TMPA datasets\nTRMMMonthly, which is used to contain information on monthly TRMM TMPA datasets","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"NASAPrecipitation.TRMM3Hourly{<:AbstractString,<:TimeType}\nNASAPrecipitation.TRMMDaily{<:AbstractString,<:TimeType}\nNASAPrecipitation.TRMMMonthly{<:AbstractString,<:TimeType}","category":"page"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMM3Hourly","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMM3Hourly","text":"TRMM3Hourly{ST<:AbstractString, DT<:TimeType} <: TRMMDataset\n\nObject containing information on 3-Hourly TRMM datasets to be downloaded\n\n\n\n\n\n","category":"type"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMMDaily","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMMDaily","text":"TRMMDaily{ST<:AbstractString, DT<:TimeType} <: TRMMDataset\n\nObject containing information on Daily TRMM datasets to be downloaded\n\n\n\n\n\n","category":"type"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMMMonthly","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMMMonthly","text":"TRMMMonthly{ST<:AbstractString, DT<:TimeType} <: TRMMDataset\n\nObject containing information on Monthly TRMM datasets to be downloaded\n\n\n\n\n\n","category":"type"},{"location":"datasets/trmm.html#Creating-a-TRMM3Hourly-dataset","page":"TRMM TMPA Datasets","title":"Creating a TRMM3Hourly dataset","text":"","category":"section"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"The TRMM3Hourly dataset structure is used to contain information regarding 3-hourly TRMM datasets.  There are two functions that create TRMM3Hourly datasets","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"TRMM3HourlyNRT, which is used to retrieve Near Real-Time runs\nTRMM3Hourly, which is used to retrieve the Final post-processing runs","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"NASAPrecipitation.TRMM3HourlyNRT\nNASAPrecipitation.TRMM3Hourly(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString\n)","category":"page"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMM3HourlyNRT","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMM3HourlyNRT","text":"TRMM3HourlyNRT(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: TRMM3Hourly{ST,DT}\n\nCreates a TRMM3Hourly dataset npd to retrieve datasets from the Near Real-Time runs for 3-Hourly output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder trmm3hourlynrt will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : trmm3hourlynrt\nlname : Near Real-Time TRMM 3-Hourly\ndoi   : 10.5067/TRMM/TMPA/3H-E/7\nhroot : https://disc2.gesdisc.eosdis.nasa.gov/opendap/TRMMRT/TRMM3B42RT.7\nfpref : 3B42RT\nfsuff : 7R2.nc4\n\n\n\n\n\n","category":"function"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMM3Hourly-2","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMM3Hourly","text":"TRMM3Hourly(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: TRMM3Hourly{ST,DT}\n\nCreates a TRMM3Hourly dataset npd to retrieve datasets from the Final post-processing runs for 3-Hourly output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder trmm3hourly will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : trmm3hourly\nlname : Final TRMM 3-Hourly\ndoi   : 10.5067/TRMM/TMPA/3H/7\nhroot : https://disc2.gesdisc.eosdis.nasa.gov/opendap/TRMML3/TRMM3B42.7\nfpref : 3B42\nfsuff : 7.HDF\n\n\n\n\n\n","category":"type"},{"location":"datasets/trmm.html#Creating-a-TRMMDaily-dataset","page":"TRMM TMPA Datasets","title":"Creating a TRMMDaily dataset","text":"","category":"section"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"The TRMMDaily dataset structure is used to contain information regarding Daily TRMM datasets.  There are two functions that create TRMMDaily datasets","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"TRMMDailyNRT, which is used to retrieve Near Real-Time runs\nTRMMDaily, which is used to retrieve the Final post-processing runs","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"NASAPrecipitation.TRMMDailyNRT\nNASAPrecipitation.TRMMDaily(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString\n)","category":"page"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMMDailyNRT","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMMDailyNRT","text":"TRMMDailyNRT(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: TRMMDaily{ST,DT}\n\nCreates a TRMMDaily dataset npd to retrieve datasets from the Near Real-Time processing runs for Daily output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder trmmdailynrt will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : trmmdailynrt\nlname : Near Real-Time TRMM Daily\ndoi   : 10.5067/TRMM/TMPA/DAY-E/7\nhroot : https://disc2.gesdisc.eosdis.nasa.gov/opendap/TRMMRT/TRMM3B42RT_Daily.7\nfpref : 3B42RT_Daily\nfsuff : 7.nc4\n\n\n\n\n\n","category":"function"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMMDaily-2","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMMDaily","text":"TRMMDaily(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: TRMMDaily{ST,DT}\n\nCreates a TRMMDaily dataset npd to retrieve datasets from the Final post-processing runs for Daily output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder trmmdaily will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : trmmdaily\nlname : Final TRMM Daily\ndoi   : 10.5067/TRMM/TMPA/DAY/7\nhroot : https://disc2.gesdisc.eosdis.nasa.gov/opendap/TRMML3/TRMM3B42_Daily.7\nfpref : 3B42_Daily\nfsuff : 7.nc4\n\n\n\n\n\n","category":"type"},{"location":"datasets/trmm.html#Creating-a-TRMMMonthly-dataset","page":"TRMM TMPA Datasets","title":"Creating a TRMMMonthly dataset","text":"","category":"section"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"The TRMMMonthly dataset structure is used to contain information regarding Monthly TRMM datasets.  There are two functions that create TRMMMonthly datasets","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"TRMMMonthlyNRT, which is used to retrieve Near Real-Time runs\nTRMMMonthly, which is used to retrieve the Final post-processing runs","category":"page"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"NASAPrecipitation.TRMMMonthly(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString\n)","category":"page"},{"location":"datasets/trmm.html#NASAPrecipitation.TRMMMonthly-2","page":"TRMM TMPA Datasets","title":"NASAPrecipitation.TRMMMonthly","text":"TRMMMonthly(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: TRMMMonthly{ST,DT}\n\nCreates a TRMMMonthly dataset npd to retrieve datasets from the Final post-processing runs for Monthly output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder trmmmonthly will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : trmmmonthly\nlname : TRMM Monthly (TMPA 3B43)\ndoi   : 10.5067/TRMM/TMPA/MONTH/7\nhroot : https://disc2.gesdisc.eosdis.nasa.gov/opendap/TRMML3/TRMM3B43.7\nfpref : 3B43\nfsuff : 7.HDF\n\n\n\n\n\n","category":"type"},{"location":"datasets/trmm.html#Example","page":"TRMM TMPA Datasets","title":"Example","text":"","category":"section"},{"location":"datasets/trmm.html","page":"TRMM TMPA Datasets","title":"TRMM TMPA Datasets","text":"using NASAPrecipitation\nnpd = TRMMMonthly(dtbeg=Date(2017,2,1),dtend=Date(2017,2,1),sroot=pwd())\ntypeof(npd)","category":"page"},{"location":"datasets/imerg.html#GPM-IMERG-Datasets","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"","category":"section"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"GPM IMERG Datasets are represented by the IMERGDataset AbstractType, which in itself is broken into the IMERGHalfHourly, IMERGDaily and IMERGMonthly Types.  For half-hourly and daily datsets, NASA provides not just the output from the final processing run, but also early and late near real-time runs.","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"The Types that each dataset calls are listed below, along with their function calls.","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":" Type Early NRT Late NRT Final NRT\n30 Mins IMERGHalfHourly IMERGEarlyHH() IMERGLateHH() IMERGFinalHH()\nDaily IMERGDaily IMERGEarlyDY() IMERGLateDY() IMERGFinalDY()\nMonthly IMERGMonthly   IMERGMonthly()","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"So, for example, if we wanted to get the the Early Near Real-Time IMERG Half-Hourly dataset, we would call the function IMERGEarlyHH, which would return a IMERGHalfHourly data structure (see example at the end of the page).","category":"page"},{"location":"datasets/imerg.html#IMERGDataset-Types-/-Objects","page":"GPM IMERG Datasets","title":"IMERGDataset Types / Objects","text":"","category":"section"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"There are three different Types of IMERGDataset:","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"IMERGHalfHourly, which is used to contain information on half-hourly GPM IMERG datasets\nIMERGDaily, which is used to contain information on daily GPM IMERG datasets\nIMERGMonthly, which is used to contain information on monthly GPM IMERG datasets","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"NASAPrecipitation.IMERGHalfHourly\nNASAPrecipitation.IMERGDaily\nNASAPrecipitation.IMERGMonthly{<:AbstractString,<:TimeType}","category":"page"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGHalfHourly","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGHalfHourly","text":"IMERGHalfHourly{ST<:AbstractString, DT<:TimeType} <: IMERGDataset\n\nObject containing information on Half-Hourly IMERG datasets to be downloaded\n\n\n\n\n\n","category":"type"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGDaily","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGDaily","text":"IMERGDaily{ST<:AbstractString, DT<:TimeType} <: IMERGDataset\n\nObject containing information on Daily IMERG datasets to be downloaded\n\n\n\n\n\n","category":"type"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGMonthly","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGMonthly","text":"IMERGMonthly{ST<:AbstractString, DT<:TimeType} <: IMERGDataset\n\nObject containing information on Montly IMERG datasets to be downloaded\n\n\n\n\n\n","category":"type"},{"location":"datasets/imerg.html#Creating-an-IMERGHalfHourly-dataset","page":"GPM IMERG Datasets","title":"Creating an IMERGHalfHourly dataset","text":"","category":"section"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"The IMERGHalfHourly dataset structure is used to contain information regarding half-hourly IMERG datasets.  There are three functions that create IMERGHalfHourly datasets","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"IMERGEarlyHH, which is used to retrieve Near Real-Time Early runs\nIMERGLateHH, which is used to retrieve Near Real-Time Late runs\nIMERGFinalHH, which is used to retrieve the Final post-processing runs","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"NASAPrecipitation.IMERGEarlyHH\nNASAPrecipitation.IMERGLateHH\nNASAPrecipitation.IMERGFinalHH","category":"page"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGEarlyHH","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGEarlyHH","text":"IMERGEarlyHH(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: IMERGHalfHourly{ST,DT}\n\nCreates a IMERGHalfHourly dataset npd to retrieve datasets from the Near Real-Time Early processing runs for Half-Hourly output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder imergearlyhh will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : imergearlyhh\nlname : Early IMERG Half-Hourly\ndoi   : 10.5067/GPM/IMERG/3B-HH-E/06\nhroot : https://gpm1.gesdisc.eosdis.nasa.gov/opendap/GPML3/GPM3IMERGHHE.06\nfpref : 3B-HHR-E.MS.MRG.3IMERG\nfsuff : V06B.HDF5\n\n\n\n\n\n","category":"function"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGLateHH","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGLateHH","text":"IMERGLateHH(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: IMERGHalfHourly{ST,DT}\n\nCreates a IMERGHalfHourly dataset npd to retrieve datasets from the Near Real-Time Late processing runs for Half-Hourly output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder imerglatehh will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : imerglatehh\nlname : Late IMERG Half-Hourly\ndoi   : 10.5067/GPM/IMERG/3B-HH-L/06\nhroot : https://gpm1.gesdisc.eosdis.nasa.gov/opendap/GPML3/GPM3IMERGHHL.06\nfpref : 3B-HHR-L.MS.MRG.3IMERG\nfsuff : V06B.HDF5\n\n\n\n\n\n","category":"function"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGFinalHH","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGFinalHH","text":"IMERGFinalHH(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: IMERGHalfHourly{ST,DT}\n\nCreates a IMERGHalfHourly dataset npd to retrieve datasets from the final post-processing runs for Half-Hourly output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder imergfinalhh will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : imergfinalhh\nlname : Final IMERG Half-Hourly\ndoi   : 10.5067/GPM/IMERG/3B-HH/06\nhroot : https://gpm1.gesdisc.eosdis.nasa.gov/opendap/GPML3/GPM3IMERGHH.06\nfpref : 3B-HHR.MS.MRG.3IMERG\nfsuff : V06B.HDF5\n\n\n\n\n\n","category":"function"},{"location":"datasets/imerg.html#Creating-an-IMERGDaily-dataset","page":"GPM IMERG Datasets","title":"Creating an IMERGDaily dataset","text":"","category":"section"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"The IMERGDaily dataset structure is used to contain information regarding daily IMERG datasets.  There are three functions that create IMERGDaily datasets","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"IMERGEarlyDY, which is used to retrieve Near Real-Time Early runs\nIMERGLateDY, which is used to retrieve Near Real-Time Late runs\nIMERGFinalDY, which is used to retrieve the Final post-processing runs","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"NASAPrecipitation.IMERGEarlyDY\nNASAPrecipitation.IMERGLateDY\nNASAPrecipitation.IMERGFinalDY","category":"page"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGEarlyDY","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGEarlyDY","text":"IMERGEarlyDY(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: IMERGDaily{ST,DT}\n\nCreates a IMERGDaily dataset npd to retrieve datasets from the Near Real-Time Early processing runs for Daily output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder imergearlydy will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : imergearlydy\nlname : Early IMERG Daily\ndoi   : 10.5067/GPM/IMERGDE/DAY/06\nhroot : https://gpm1.gesdisc.eosdis.nasa.gov/opendap/GPML3/GPM3IMERGDE.06\nfpref : 3B-DAY-E.MS.MRG.3IMERG\nfsuff : S000000-E235959.V06.nc4\n\n\n\n\n\n","category":"function"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGLateDY","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGLateDY","text":"IMERGLateDY(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: IMERGDaily{ST,DT}\n\nCreates a IMERGDaily dataset npd to retrieve datasets from the Near Real-Time Late processing runs for Daily output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder imerglatedy will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : imerglatedy\nlname : Late IMERG Daily\ndoi   : 10.5067/GPM/IMERGDL/DAY/06\nhroot : https://gpm1.gesdisc.eosdis.nasa.gov/opendap/GPML3/GPM3IMERGDL.06\nfpref : 3B-DAY-L.MS.MRG.3IMERG\nfsuff : S000000-E235959.V06.nc4\n\n\n\n\n\n","category":"function"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGFinalDY","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGFinalDY","text":"IMERGFinalDY(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: IMERGDaily{ST,DT}\n\nCreates a IMERGDaily dataset npd to retrieve datasets from the Final post-processing runs for Daily output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder imergfinaldy will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : imergfinaldy\nnpdID : Final IMERG Daily\ndoi   : 10.5067/GPM/IMERGDF/DAY/06\nhroot : https://gpm1.gesdisc.eosdis.nasa.gov/opendap/GPML3/GPM3IMERGDF.06\nfpref : 3B-DAY.MS.MRG.3IMERG\nfsuff : S000000-E235959.V06.nc4\n\n\n\n\n\n","category":"function"},{"location":"datasets/imerg.html#Creating-an-IMERGMonthly-dataset","page":"GPM IMERG Datasets","title":"Creating an IMERGMonthly dataset","text":"","category":"section"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"The IMERGMonthly dataset structure is used to contain information monthly daily IMERG datasets.  There is only one functions that creates IMERGMonthly datasets","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"IMERGMonthly, which is used to retrieve the Final post-processing runs","category":"page"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"NASAPrecipitation.IMERGMonthly(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString\n)","category":"page"},{"location":"datasets/imerg.html#NASAPrecipitation.IMERGMonthly-2","page":"GPM IMERG Datasets","title":"NASAPrecipitation.IMERGMonthly","text":"IMERGMonthly(\n    ST = String,\n    DT = Date;\n    dtbeg :: TimeType,\n    dtend :: TimeType,\n    sroot :: AbstractString,\n) -> npd :: IMERGMonthly{ST,DT}\n\nCreates a IMERGMonthly dataset npd to retrieve datasets for Monthly output\n\nKeyword Arguments\n\ndtbeg : Date at which download / analysis of the dataset begins\ndtend : Date at which download / analysis of the dataset ends\nsroot : The directory in which the folder imergmonthly will be created for data downloads, storage and analysis\n\nThe following fields in npd will be fixed as below:\n\nnpdID : imergmonthly\nlname : IMERG Monthly\ndoi   : 10.5067/GPM/IMERG/3B-MONTH/06\nhroot : https://gpm1.gesdisc.eosdis.nasa.gov/opendap/GPML3/GPM3IMERGM.06\nfpref : 3B-MO.MS.MRG.3IMERG\nfsuff : V06B.HDF5\n\n\n\n\n\n","category":"type"},{"location":"datasets/imerg.html#Example","page":"GPM IMERG Datasets","title":"Example","text":"","category":"section"},{"location":"datasets/imerg.html","page":"GPM IMERG Datasets","title":"GPM IMERG Datasets","text":"using NASAPrecipitation\nnpd = IMERGEarlyHH(dtbeg=Date(2017,2,1),dtend=Date(2017,2,1),sroot=pwd())\ntypeof(npd)","category":"page"},{"location":"download/download.html#Download-API-and-Examples","page":"API for Downloads","title":"Download API and Examples","text":"","category":"section"},{"location":"download/download.html","page":"API for Downloads","title":"API for Downloads","text":"NASAPrecipitation.download","category":"page"},{"location":"download/download.html#Base.download","page":"API for Downloads","title":"Base.download","text":"download(\n    npd :: NASAPrecipitationDataset,\n    geo :: GeoRegion\n) -> nothing\n\nDownloads a NASA Precipitation dataset specified by npd for a GeoRegion specified by geo\n\nArguments\n\nnpd : a NASAPrecipitationDataset specifying the dataset details and date download range\ngeo : a GeoRegion (see GeoRegions.jl) that sets the geographic bounds of the data array in lon-lat\n\n\n\n\n\n","category":"function"},{"location":"download/georegions.html#A-Basic-Primer-to-GeoRegions","page":"Introduction to GeoRegions","title":"A Basic Primer to GeoRegions","text":"","category":"section"},{"location":"datasets/landseamask.html#Land-Sea-Mask-Datasets","page":"Land-Sea Mask Datasets","title":"Land-Sea Mask Datasets","text":"","category":"section"},{"location":"datasets/landseamask.html","page":"Land-Sea Mask Datasets","title":"Land-Sea Mask Datasets","text":"Test","category":"page"},{"location":"index.html#[NASAPrecipitation.jl](https://github.com/natgeo-wong/NASAPrecipitation.jl)","page":"Home","title":"NASAPrecipitation.jl","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"Managing Datasets from the NASA Precipitation Measurement Mission","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"NASAPrecipitation.jl is a Julia package that aims to streamline the following processes:","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"downloads of NASA Precipitation Measurement Mission datasets\nbasic analysis of said datasets\nperform all the above operations innately over a given geographical region using the GeoRegion functionality of GeoRegions.jl (v2 and above)","category":"page"},{"location":"index.html#Installation-Instructions","page":"Home","title":"Installation Instructions","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"NASAPrecipitation.jl has not been officially registered as a Julia package yet.  To install it, add it directly using the GitHub link as follows:","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"julia> ]\n(@v1.6) pkg> add https://github.com/natgeo-wong/NASAPrecipitation.jl.git","category":"page"},{"location":"index.html#Documentation-Overview","page":"Home","title":"Documentation Overview","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"The documentation for NASAPrecipitation.jl is divided into three components:","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"Tutorials - meant as an introduction to the package\nHow-to Examples - geared towards those looking for specific examples of what can be done\nAPI Reference - comprehensive summary of all exported functionalities","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"tip: Obtaining Example Datasets\nAll the output for the coding examples were produced using my computer with key security information (such as login info) omitted.  The examples cannot be run online because the file size requirements are too big.  Copying and pasting the code examples (with relevant directory and login information changes) should produce the same results.","category":"page"},{"location":"index.html#Getting-help","page":"Home","title":"Getting help","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"If you are interested in using NASAPrecipitation.jl or are trying to figure out how to use it, please feel free to ask me questions and get in touch!  Please feel free to open an issue if you have any questions, comments, suggestions, etc!","category":"page"}]
